// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SimpleStorage {
  uint256 value;
  mapping(address=>uint) myApple;  //      mapping 

  function read() public view returns (uint256) {
    return value;
  }

  function write(uint256 newValue) payable public {
    value = newValue;
    myApple[msg.sender]++;      //   0   1 
  }
  // function buyApple() payable public{
  //   // msg.sender : contract       
  //   myApple[msg.sender]++;      //   0   1 
  // }

  function getMyApple() public view returns(uint){
    return myApple[msg.sender];
  }

  function sellApple(uint _applePrice) payable external{
    uint totalPrice = (myApple[msg.sender] * _applePrice);
                      //     * 
    myApple[msg.sender] = 0;    //  0 
    payable(msg.sender).transfer(totalPrice);    //  
  }

  function sellOneApple(uint _applePrice) payable external {
    myApple[msg.sender]--;
    payable(msg.sender).transfer(_applePrice);
  }

  //////////////////////ssfari campus////////////////////////

  struct Item {
    uint32 price;
    string title;
  }

  event NewItem(uint itemId, uint32 price, string title);

  Item[] public items;
  mapping(address => Item) ownerToItem;

  function registItem(uint32 price, string calldata title) public {
    items.push(Item(price, title));
    ownerToItem[msg.sender] = Item(price, title);
    uint itemId = items.length;
    emit NewItem(itemId, price, title);
  }

  function readItem(address _address) public view returns(Item memory) {
    return ownerToItem[_address];
  }
}
